import React from 'react'
import { FlexCol, PaddingX } from '../constants/style'

export default function Header() {
  return (
    <div className={`flex pl-[102px] bg-background relative`}>
        <img src='../images/logoBurgerIcon.png'/>
        <img src='../images/logoBurger.png' className={`h-[60px] pt-[8px]`}/>
    </div>
  )
}
